import React from "react";
import Historyprops from "./Historyprops";

const Historysecond = () => {
  return (
    <>
      <div className="history-outer">
        <div className="container">
          <div className="history-title">
            <p>our workshop history</p>
            <div className="h-t"></div>
          </div>
          <div className="history-inner">
            <div className="history-inner-child">

            </div>
            <div className="history-inner-child">
              <Historyprops title="Start with small space" year="1995" img="assets/image/h1.jpg" />
            </div>
          </div>
        </div>
      </div>
    </>
  );
};

export default Historysecond;
